        ADVANCE(2);
      if (lookahead == '\"')
        ADVANCE(4);
      if (lookahead == '#')
        ADVANCE(5);
      if (lookahead == '%')
        ADVANCE(48);
      if (lookahead == '&')
        ADVANCE(49);
      if (lookahead == '\'')
        ADVANCE(52);
